import React from 'react'

const Navbaar = ({mode,enableDarkMOde}) => {
  const toDanger=()=>{
    document.body.style.backgroundColor="red"
  }
  return (
<div>
<nav class={`navbar navbar-${mode} bg-${mode} p-3`}>
<div class="form-check form-switch">
<input onClick={enableDarkMOde} class="form-check-input" type="checkbox" id="flexSwitchCheckDefault"/>
</div>
<button className='btn btn-danger' onClick={toDanger}>RED</button>
<button className='btn btn-primary'>BLUE</button>
<button className='btn btn-success'>GREEN</button>
</nav>
</div>
  )
}

export default Navbaar
